  (285,'192.168.22.90','../gameserver01/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,1,'[Gateway]\r\nIp=127.0.0.1\r\nPort=5633\r\n\r\n[Database]\r\nIp=127.0.0.1\r\nPort=5001\r\n\r\n[Log]\r\nIp=127.0.0.1\r\nPort=5656\r\n\r\n[Gamecenter]\r\nIp=127.0.0.1\r\nPort=5135\r\n\r\n[GameServer]\r\nServerID=1\r\nInAdapterIdx=1\r\nOutAdapterIdx=1\r\nInIp=\r\nOutIp=\r\nPort=6041\r\nSendInterval=3\r\n\r\n[Overload]\r\nMaxPlayer=800\r\nPrecision=100\r\n\r\n;服务器自身加载地图（只对MiniServer有效）\r\n[WorldSet]\r\nCount=8\r\nWorld00=1\r\nWorld01=2\r\nWorld02=3\r\nWorld03=4\r\nWorld04=5\r\nWorld05=6\r\nWorld06=7\r\nWorld07=8',240,NULL,NULL,NULL),
  (296,'192.168.22.90','../gameserver02/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,1,'[Gateway]\r\nIp=127.0.0.1\r\nPort=5633\r\n\r\n[Database]\r\nIp=127.0.0.1\r\nPort=5001\r\n\r\n[Log]\r\nIp=127.0.0.1\r\nPort=5656\r\n\r\n[Gamecenter]\r\nIp=127.0.0.1\r\nPort=5135\r\n\r\n[GameServer]\r\nServerID=2\r\nInAdapterIdx=1\r\nOutAdapterIdx=1\r\nInIp=\r\nOutIp=\r\nPort=6042\r\nSendInterval=3\r\n\r\n[Overload]\r\nMaxPlayer=800\r\nPrecision=100\r\n\r\n;服务器自身加载地图（只对MiniServer有效）\r\n[WorldSet]\r\nCount=8\r\nWorld00=1\r\nWorld01=2\r\nWorld02=3\r\nWorld03=4\r\nWorld04=5\r\nWorld05=6\r\nWorld06=7\r\nWorld07=8',240,NULL,NULL,NULL),
  (307,'192.168.22.90','../gameserver03/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,1,'[Gateway]\r\nIp=127.0.0.1\r\nPort=5633\r\n\r\n[Database]\r\nIp=127.0.0.1\r\nPort=5001\r\n\r\n[Log]\r\nIp=127.0.0.1\r\nPort=5656\r\n\r\n[Gamecenter]\r\nIp=127.0.0.1\r\nPort=5135\r\n\r\n[GameServer]\r\nServerID=3\r\nInAdapterIdx=1\r\nOutAdapterIdx=1\r\nInIp=\r\nOutIp=\r\nPort=6043\r\nSendInterval=3\r\n\r\n[Overload]\r\nMaxPlayer=800\r\nPrecision=100\r\n\r\n;服务器自身加载地图（只对MiniServer有效）\r\n[WorldSet]\r\nCount=8\r\nWorld00=1\r\nWorld01=2\r\nWorld02=3\r\nWorld03=4\r\nWorld04=5\r\nWorld05=6\r\nWorld06=7\r\nWorld07=8',240,NULL,NULL,NULL),
  (252,'192.168.22.90','../goddess/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,4,'[Version]\r\n;版本号，保留用，目前必须指定为2\r\nVersion=2\r\n\r\n[KG_Goddess]\r\n;监听IP、端口，用于存取角色数据，由Bishop,GameServer连接\r\nListenIP=127.0.0.1\r\nListenPort=5001\r\n\r\n;数据接收循环中两次循环的间隔时间，单位为毫秒，不要设置为0\r\nLoopSleepTime=10\r\n\r\n;自动断线时间，如果在这个时间内没有收到数据包则自动断开连接，单位为毫秒\r\nAutoDisconnectTime=1800000\r\n\r\n;收发数据的超时时间，单位为毫秒\r\nSendRecvTimeout=60000\r\n\r\n;分区名\r\nZoneName=zone.x\r\n\r\n;网关名,该值应在不同区之间也保持唯一，建议设定为bishop登录paysys时的帐号名,\r\nGatewayName=swtest3\r\n\r\n;在本组服务器内，一个帐号允许创建的最大角色数目\r\n;一个账号由于并服的原因，可能会存在大于这个限制的角色数，\r\n;但只有当角色数目低于这个限制时才允许再创建新角色\r\nMaxRoleCountInAccount=12\r\n\r\n;是否开启角色锁定功能。\r\n;当开启此功能后，不能读取已锁定角色，\r\n;保存角色前要先加锁，只允许对角色执行锁定操作的客户端保存角色。\r\n;剑网2设置为非0（开启）， 剑网3设置为0（关闭）\r\nEnableRoleLockFlag=1\r\n\r\n[DatabaseServer]\r\n;数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n;指定数据库服务器上的数据库，角色信息将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\n;为保证每组游戏服务器独有一个角色数据库，建议数据库名设置成与GatewayName相关联的名字，从而保证唯一\r\nDatabase=swtest3_goddess\r\n;Database=gate0101_goddess\r\n\r\n[LogServer]\r\n;客服日志数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n;指定数据库服务器上的数据库，玩家物品操作日志和玩家行为日志将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\nDatabase=swtest3_goddess_logserver\r\n\r\n;最小物品价值量(该值为unsigned类型)，低于该价值的物品，其操作日志被过滤，不存入数据库\r\nMinItemValue=0\r\n\r\n;最低行为重要等级(该值为unsigned类型)，低于该值的玩家行为日志被过滤，不存入数据库\r\nMinPlayerActionLevel=0\r\n\r\n[NameServer]\r\n;唯一命名数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n;指定唯一命名服务器上的数据库，用于创建唯一的角色名，帮会名等\r\n;如果该数据库在服务器上不存在，将会自动创建\r\nDatabase=global_nameserver\r\n\r\n;在一个大区内，一个帐号允许创建的最大角色数目\r\n;若设置为0，表示不限制一个帐号所能创建的角色数目\r\nMaxRoleCountInAccountPerZone=12\r\n\r\n[RoleStatistic]\r\n;监听IP、端口，供统计程序KG_StatGameData发送统计结果给Goddess\r\nListenIP=127.0.0.1\r\nListenPort=6001\r\n\r\n;收发数据的超时时间，单位为毫秒\r\nSendRecvTimeout=60000\r\n\r\n[Control]\r\n;这一节为linux下的UI控制使用的。\r\n;如果DaemonFlag＝1，则程序进入后台运行\r\n;(不显示控制界面，需要用telnet连接到下面的端口控制程序）；\r\n;否则按一般程序运行（提供界面控制）。\r\n;ControlPort是为了重新获得控制程序终端的端口\r\n;如果要在同一台机器上运行几个goddess服务，下面的端口每个服务都不能相同\r\nDaemonFlag=0\r\nControlPort=7001\r\n',240,NULL,NULL,NULL),
  (241,'192.168.22.90','../bishop/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,3,'[Version]\r\n#版本号，各项目依次为bishop1, bishop2, bishop3\r\nVersion=bishop2\r\n\r\n#注意,凡是关于时间的参数,单位都是毫秒!\r\n\r\n[Paysys]\r\n#Paysys的地址和开放端口，注意，如果Bishop机器和Paysys机器都有块外网网卡的话，就填Paysys的外网IP！\r\nIPAddress=192.168.22.19\r\nPort=8000\r\n#Bishop本地IP地址，如果有配置，Bishop将提取此IP地址对应的网卡物理地址发送给Paysys，否则默认取外网网卡地址\r\n#LocalIPAddress=\r\n#内网地址掩码，程序内部用它来标示“形如什么样的地址是内网地址”\r\n#InternalIPAddressMask=192.168.0.0\r\n#连接Paysys的用户名和密码,在剑网旧Paysys中,这个是在Paysys的数据库里面定义的,在KOL新的Paysys中,这个在配置文件ggw.conf中\r\nUserName=swtest3\r\nPassword=a\r\n#Socket流的send,recv超时时间\r\nSendRecvTimeout=60000\r\n#与Paysys的连接断开后,多长时间自动重连一次!\r\nReconnectTime=10000\r\n#Paysys模块在每个工作循环中,每个循环中sleep多久!\r\nLoopTime=50\r\n#多久ping一次\r\nPingTime=10000\r\n\r\n#下面其他的参数,没有说明的就是同上!\r\n\r\n[Goddess]\r\nIPAddress=127.0.0.1\r\nPort=5001\r\nSendRecvTimeout=60000\r\nReconnectTime=10000\r\nLoopTime=50\r\nPingTime=20000\r\n\r\n[Relay]\r\nLocalIPAddress=\r\nOpenPort=5632\r\nSendRecvTimeout=60000\r\nLoopTime=50\r\nPingTime=20000\r\n\r\n[Report]\r\nLocalIPAddress=\r\nOpenPort=5636\r\nSendRecvTimeout=60000\r\nLoopTime=50\r\nPingTime=20000\r\n\r\n[GameServer]\r\nLocalIPAddress=\r\nOpenPort=5633\r\nSendRecvTimeout=180000\r\nLoopTime=50\r\n#如果在PingTime这么长的时间内没有收到Game server的任何数据包，那么，Bishop会认为Game server已经挂了!\r\nPingTime=1800000\r\n\r\n[Player]\r\nLocalIPAddress=\r\nOpenPort=5622\r\n#Bishop内部用线程池来为每个客户端连接服务，这个参数指名了线程池中的线程数!如果是内部调试，建议不要开得很大，几个足矣!\r\nMaxPlayers=512\r\n#限制处于身份验证阶段的玩家数\r\nMaxPlayerInLoginSection=32\r\nSendRecvTimeout=180000\r\n#允许用户停留在登陆界面上进行新建角色,删除角色,选择角色登陆的时间!\r\nPlayerOperateTimeout=180000\r\nDeleteRoleVerify=0\r\nIBSupport=1\r\n#防沉迷帐号登录控制\r\nLimitPlayTimeLoginCtrl=4\r\n#玩家当前所在GameServer人满时，是否自动尝试使其返回重生点\r\nAutoUseRevival=0\r\n\r\n[LiveTimeLogger]\r\n#Bishop会定期记录自己最后正常运行的时间,这个参数就是做这个记录的周期!\r\nLiveTimeLoggerLoopTime=5000\r\n\r\n\r\n[Control]\r\nDaemonFlag=0\r\nControlPort=5566\r\n\r\n[Debug]\r\nSyncTime=1',240,NULL,NULL,NULL),
  (370,'192.168.22.84','../bishop/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,3,'[Version]\r\n#版本号，各项目依次为bishop1, bishop2, bishop3\r\nVersion=bishop2\r\n\r\n#注意,凡是关于时间的参数,单位都是毫秒!\r\n\r\n[Paysys]\r\n#Paysys的地址和开放端口，注意，如果Bishop机器和Paysys机器都有块外网网卡的话，就填Paysys的外网IP！\r\nIPAddress=192.168.22.19\r\nPort=8000\r\n#Bishop本地IP地址，如果有配置，Bishop将提取此IP地址对应的网卡物理地址发送给Paysys，否则默认取外网网卡地址\r\n#LocalIPAddress=\r\n#内网地址掩码，程序内部用它来标示“形如什么样的地址是内网地址”\r\n#InternalIPAddressMask=192.168.0.0\r\n#连接Paysys的用户名和密码,在剑网旧Paysys中,这个是在Paysys的数据库里面定义的,在KOL新的Paysys中,这个在配置文件ggw.conf中\r\nUserName=swtest2\r\nPassword=a\r\n#Socket流的send,recv超时时间\r\nSendRecvTimeout=60000\r\n#与Paysys的连接断开后,多长时间自动重连一次!\r\nReconnectTime=10000\r\n#Paysys模块在每个工作循环中,每个循环中sleep多久!\r\nLoopTime=50\r\n#多久ping一次\r\nPingTime=10000\r\n\r\n#下面其他的参数,没有说明的就是同上!\r\n\r\n[Goddess]\r\nIPAddress=127.0.0.1\r\nPort=5001\r\nSendRecvTimeout=60000\r\nReconnectTime=10000\r\nLoopTime=50\r\nPingTime=20000\r\n\r\n[Relay]\r\nLocalIPAddress=\r\nOpenPort=5632\r\nSendRecvTimeout=60000\r\nLoopTime=50\r\nPingTime=20000\r\n\r\n[Report]\r\nLocalIPAddress=\r\nOpenPort=5636\r\nSendRecvTimeout=60000\r\nLoopTime=50\r\nPingTime=20000\r\n\r\n[GameServer]\r\nLocalIPAddress=\r\nOpenPort=5633\r\nSendRecvTimeout=180000\r\nLoopTime=50\r\n#如果在PingTime这么长的时间内没有收到Game server的任何数据包，那么，Bishop会认为Game server已经挂了!\r\nPingTime=1800000\r\n\r\n[Player]\r\nLocalIPAddress=\r\nOpenPort=5622\r\n#Bishop内部用线程池来为每个客户端连接服务，这个参数指名了线程池中的线程数!如果是内部调试，建议不要开得很大，几个足矣!\r\nMaxPlayers=512\r\n#限制处于身份验证阶段的玩家数\r\nMaxPlayerInLoginSection=32\r\nSendRecvTimeout=180000\r\n#允许用户停留在登陆界面上进行新建角色,删除角色,选择角色登陆的时间!\r\nPlayerOperateTimeout=180000\r\nDeleteRoleVerify=0\r\nIBSupport=1\r\n#防沉迷帐号登录控制\r\nLimitPlayTimeLoginCtrl=0\r\n#玩家当前所在GameServer人满时，是否自动尝试使其返回重生点\r\nAutoUseRevival=0\r\n\r\n[LiveTimeLogger]\r\n#Bishop会定期记录自己最后正常运行的时间,这个参数就是做这个记录的周期!\r\nLiveTimeLoggerLoopTime=5000\r\n\r\n\r\n[Control]\r\nDaemonFlag=0\r\nControlPort=5566\r\n\r\n[Debug]\r\nSyncTime=1',240,NULL,NULL,NULL),
  (381,'192.168.22.84','../goddess/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,4,'[Version]\r\n;版本号，保留用，目前必须指定为2\r\nVersion=2\r\n\r\n[KG_Goddess]\r\n;监听IP、端口，用于存取角色数据，由Bishop,GameServer连接\r\nListenIP=127.0.0.1\r\nListenPort=5001\r\n\r\n;数据接收循环中两次循环的间隔时间，单位为毫秒，不要设置为0\r\nLoopSleepTime=10\r\n\r\n;自动断线时间，如果在这个时间内没有收到数据包则自动断开连接，单位为毫秒\r\nAutoDisconnectTime=1800000\r\n\r\n;收发数据的超时时间，单位为毫秒\r\nSendRecvTimeout=60000\r\n\r\n;分区名\r\nZoneName=zone.x\r\n\r\n;网关名,该值应在不同区之间也保持唯一，建议设定为bishop登录paysys时的帐号名,\r\nGatewayName=swtest2\r\n\r\n;在本组服务器内，一个帐号允许创建的最大角色数目\r\n;一个账号由于并服的原因，可能会存在大于这个限制的角色数，\r\n;但只有当角色数目低于这个限制时才允许再创建新角色\r\nMaxRoleCountInAccount=120\r\n\r\n;是否开启角色锁定功能。\r\n;当开启此功能后，不能读取已锁定角色，\r\n;保存角色前要先加锁，只允许对角色执行锁定操作的客户端保存角色。\r\n;剑网2设置为非0（开启）， 剑网3设置为0（关闭）\r\nEnableRoleLockFlag=1\r\n\r\n[DatabaseServer]\r\n;数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n;指定数据库服务器上的数据库，角色信息将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\n;为保证每组游戏服务器独有一个角色数据库，建议数据库名设置成与GatewayName相关联的名字，从而保证唯一\r\nDatabase=swtest2_goddess\r\n;Database=gate0101_goddess\r\n\r\n[LogServer]\r\n;客服日志数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n;指定数据库服务器上的数据库，玩家物品操作日志和玩家行为日志将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\nDatabase=swtest2_goddess_logserver\r\n\r\n;最小物品价值量(该值为unsigned类型)，低于该价值的物品，其操作日志被过滤，不存入数据库\r\nMinItemValue=0\r\n\r\n;最低行为重要等级(该值为unsigned类型)，低于该值的玩家行为日志被过滤，不存入数据库\r\nMinPlayerActionLevel=0\r\n\r\n[NameServer]\r\n;唯一命名数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n;指定唯一命名服务器上的数据库，用于创建唯一的角色名，帮会名等\r\n;如果该数据库在服务器上不存在，将会自动创建\r\nDatabase=global_nameserver\r\n\r\n;在一个大区内，一个帐号允许创建的最大角色数目\r\n;若设置为0，表示不限制一个帐号所能创建的角色数目\r\nMaxRoleCountInAccountPerZone=0\r\n\r\n[RoleStatistic]\r\n;监听IP、端口，供统计程序KG_StatGameData发送统计结果给Goddess\r\nListenIP=127.0.0.1\r\nListenPort=6001\r\n\r\n;收发数据的超时时间，单位为毫秒\r\nSendRecvTimeout=60000\r\n\r\n[Control]\r\n;这一节为linux下的UI控制使用的。\r\n;如果DaemonFlag＝1，则程序进入后台运行\r\n;(不显示控制界面，需要用telnet连接到下面的端口控制程序）；\r\n;否则按一般程序运行（提供界面控制）。\r\n;ControlPort是为了重新获得控制程序终端的端口\r\n;如果要在同一台机器上运行几个goddess服务，下面的端口每个服务都不能相同\r\nDaemonFlag=0\r\nControlPort=7001\r\n',240,NULL,NULL,NULL),
  (392,'192.168.22.84','../gamecenter/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,5,'[Gamecenter]\r\n;本机IP\r\nLocalIp=127.0.0.1\r\n;开放端口\r\nPort=5135\r\n\r\n[DatabaseServer]\r\n;数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n;数据库服务器：端口\r\nPort=3306\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n;指定数据库服务器上的数据库，角色信息将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\nDatabase=swtest2_gamecenter\r\n;Database=swtest3_gamecenter\r\n\r\n[StatLogDatabase]\r\n;统计Log数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n;统计Log数据库服务器：端口\r\nPort=3306\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n;指定数据库服务器上的数据库，角色信息将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\nDatabase=swtest2_statlog\r\n\r\n[Bishop]\r\nServerIP=127.0.0.1\r\nPort=5632\r\n\r\n[Log]\r\nIp=127.0.0.1\r\nPort=5656\r\n\r\n[Goddess]\r\nIp=127.0.0.1\r\nPort=5001\r\n',240,'192.168.22.106','swtest2',NULL),
  (403,'192.168.22.84','../logserver/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,7,'[Connection]\r\n;LogServer服务端口，缺省为5656\r\nPort=5656\r\n\r\n[Database]\r\n;MySQL服务器的IP\r\nHost=192.168.22.53\r\n;MySQL服务器的端口，缺省为3306\r\nPort=3306\r\n;MySQL的登录用户名\r\nUser=anonymous\r\n;登录密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n;数据库名\r\nDatabase=swtest2_logserver\r\n',240,NULL,NULL,NULL),
  (414,'192.168.22.84','../gameserver01/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,1,'[Gateway]\r\nIp=127.0.0.1\r\nPort=5633\r\n\r\n[Database]\r\nIp=127.0.0.1\r\nPort=5001\r\n\r\n[Log]\r\nIp=127.0.0.1\r\nPort=5656\r\n\r\n[Gamecenter]\r\nIp=127.0.0.1\r\nPort=5135\r\n\r\n[GameServer]\r\nServerID=1\r\nInAdapterIdx=1\r\nOutAdapterIdx=1\r\nInIp=\r\nOutIp=\r\nPort=6041\r\nSendInterval=4\r\n\r\n[Overload]\r\nMaxPlayer=800\r\nPrecision=100\r\n\r\n;服务器自身加载地图（只对MiniServer有效）\r\n[WorldSet]\r\nCount=8\r\nWorld00=1\r\nWorld01=2\r\nWorld02=3\r\nWorld03=4\r\nWorld04=5\r\nWorld05=6\r\nWorld06=7\r\nWorld07=8\r\n',240,NULL,NULL,NULL),
  (425,'192.168.22.84','../gameserver02/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,1,'[Gateway]\r\nIp=127.0.0.1\r\nPort=5633\r\n\r\n[Database]\r\nIp=127.0.0.1\r\nPort=5001\r\n\r\n[Log]\r\nIp=127.0.0.1\r\nPort=5656\r\n\r\n[Gamecenter]\r\nIp=127.0.0.1\r\nPort=5135\r\n\r\n[GameServer]\r\nServerID=2\r\nInAdapterIdx=1\r\nOutAdapterIdx=1\r\nInIp=\r\nOutIp=\r\nPort=6042\r\nSendInterval=4\r\n\r\n[Overload]\r\nMaxPlayer=800\r\nPrecision=100\r\n\r\n;服务器自身加载地图（只对MiniServer有效）\r\n[WorldSet]\r\nCount=8\r\nWorld00=1\r\nWorld01=2\r\nWorld02=3\r\nWorld03=4\r\nWorld04=5\r\nWorld05=6\r\nWorld06=7\r\nWorld07=8\r\n',240,NULL,NULL,NULL),
  (696,'192.168.22.36','../bishop/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,3,'[Version]\r\n\r\n#版本号，各项目依次为bishop1, bishop2, bishop3\r\n\r\nVersion=bishop2\r\n\r\n\r\n\r\n#注意,凡是关于时间的参数,单位都是毫秒!\r\n\r\n\r\n\r\n[Paysys]\r\n\r\n#Paysys的地址和开放端口，注意，如果Bishop机器和Paysys机器都有块外网网卡的话，就填Paysys的外网IP！\r\n\r\nIPAddress=192.168.22.19\r\n\r\nPort=8000\r\n\r\n#Bishop本地IP地址，如果有配置，Bishop将提取此IP地址对应的网卡物理地址发送给Paysys，否则默认取外网网卡地址\r\n\r\n#LocalIPAddress=\r\n\r\n#内网地址掩码，程序内部用它来标示“形如什么样的地址是内网地址”\r\n\r\n#InternalIPAddressMask=192.168.0.0\r\n\r\n#连接Paysys的用户名和密码,在剑网旧Paysys中,这个是在Paysys的数据库里面定义的,在KOL新的Paysys中,这个在配置文件ggw.conf中\r\n\r\nUserName=swdev10\r\n\r\nPassword=a\r\n\r\n#Socket流的send,recv超时时间\r\n\r\nSendRecvTimeout=60000\r\n\r\n#与Paysys的连接断开后,多长时间自动重连一次!\r\n\r\nReconnectTime=10000\r\n\r\n#Paysys模块在每个工作循环中,每个循环中sleep多久!\r\n\r\nLoopTime=50\r\n\r\n#多久ping一次\r\n\r\nPingTime=10000\r\n\r\n\r\n\r\n#下面其他的参数,没有说明的就是同上!\r\n\r\n\r\n\r\n[Goddess]\r\n\r\nIPAddress=localhost\r\n\r\nPort=5001\r\n\r\nSendRecvTimeout=60000\r\n\r\nReconnectTime=10000\r\n\r\nLoopTime=50\r\n\r\nPingTime=20000\r\n\r\n\r\n\r\n[Relay]\r\n\r\nLocalIPAddress=\r\n\r\nOpenPort=5632\r\n\r\nSendRecvTimeout=60000\r\n\r\nLoopTime=50\r\n\r\nPingTime=20000\r\n\r\n\r\n\r\n[Report]\r\n\r\nLocalIPAddress=\r\n\r\nOpenPort=5636\r\n\r\nSendRecvTimeout=60000\r\n\r\nLoopTime=50\r\n\r\nPingTime=20000\r\n\r\n\r\n\r\n[GameServer]\r\n\r\nLocalIPAddress=\r\n\r\nOpenPort=5633\r\n\r\nSendRecvTimeout=180000\r\n\r\nLoopTime=50\r\n\r\n#如果在PingTime这么长的时间内没有收到Game server的任何数据包，那么，Bishop会认为Game server已经挂了!\r\n\r\nPingTime=1800000\r\n\r\n\r\n\r\n[Player]\r\n\r\nLocalIPAddress=\r\n\r\nOpenPort=5622\r\n\r\n#Bishop内部用线程池来为每个客户端连接服务，这个参数指名了线程池中的线程数!如果是内部调试，建议不要开得很大，几个足矣!\r\n\r\nMaxPlayers=512\r\n\r\n#限制处于身份验证阶段的玩家数\r\n\r\nMaxPlayerInLoginSection=32\r\n\r\nSendRecvTimeout=180000\r\n\r\n#允许用户停留在登陆界面上进行新建角色,删除角色,选择角色登陆的时间!\r\n\r\nPlayerOperateTimeout=180000\r\n\r\nDeleteRoleVerify=0\r\n\r\nIBSupport=1\r\n\r\n#防沉迷帐号登录控制\r\n\r\nLimitPlayTimeLoginCtrl=0\r\n\r\n#玩家当前所在GameServer人满时，是否自动尝试使其返回重生点\r\n\r\nAutoUseRevival=0\r\n\r\n\r\n\r\n[LiveTimeLogger]\r\n\r\n#Bishop会定期记录自己最后正常运行的时间,这个参数就是做这个记录的周期!\r\n\r\nLiveTimeLoggerLoopTime=5000\r\n\r\n\r\n\r\n\r\n\r\n[Control]\r\n\r\nDaemonFlag=1\r\n\r\nControlPort=5566\r\n\r\n\r\n\r\n[Debug]\r\n\r\nSyncTime=1\r\n\r\n',240,NULL,NULL,NULL),
  (697,'192.168.22.36','../goddess/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,4,'[Version]\r\n\r\n;版本号，保留用，目前必须指定为2\r\n\r\nVersion=2\r\n\r\n\r\n\r\n[KG_Goddess]\r\n\r\n;监听IP、端口，用于存取角色数据，由Bishop,GameServer连接\r\n\r\nListenIP=127.0.0.1\r\n\r\nListenPort=5001\r\n\r\n\r\n\r\n;数据接收循环中两次循环的间隔时间，单位为毫秒，不要设置为0\r\n\r\nLoopSleepTime=10\r\n\r\n\r\n\r\n;自动断线时间，如果在这个时间内没有收到数据包则自动断开连接，单位为毫秒\r\n\r\nAutoDisconnectTime=120000\r\n\r\n\r\n\r\n;收发数据的超时时间，单位为毫秒\r\n\r\nSendRecvTimeout=60000\r\n\r\n\r\n\r\n;分区名\r\n\r\nZoneName=zone.x\r\n\r\n\r\n\r\n;网关名,该值应在不同区之间也保持唯一，建议设定为bishop登录paysys时的帐号名,\r\n\r\nGatewayName=gateway.x\r\n\r\n\r\n\r\n;在本组服务器内，一个帐号允许创建的最大角色数目\r\n\r\n;一个账号由于并服的原因，可能会存在大于这个限制的角色数，\r\n\r\n;但只有当角色数目低于这个限制时才允许再创建新角色\r\n\r\nMaxRoleCountInAccount=12\r\n\r\n\r\n\r\n;是否开启角色锁定功能。\r\n\r\n;当开启此功能后，不能读取已锁定角色，\r\n\r\n;保存角色前要先加锁，只允许对角色执行锁定操作的客户端保存角色。\r\n\r\n;剑网2设置为非0（开启）， 剑网3设置为0（关闭）\r\n\r\nEnableRoleLockFlag=1\r\n\r\n\r\n\r\n[DatabaseServer]\r\n\r\n;角色数据库服务器：机器名或IP\r\n\r\nServer=192.168.22.53\r\n\r\n\r\n\r\n;操作数据库用的用户名\r\n\r\nUserName=anonymous\r\n\r\n\r\n\r\n;操作数据库用的密码\r\n\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n\r\n\r\n;指定数据库服务器上的数据库，角色信息将会保存在这个数据库中\r\n\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\n\r\n;为保证每组游戏服务器独有一个角色数据库，建议数据库名设置成与GatewayName相关联的名字，从而保证唯一\r\n\r\nDatabase=swdev10_goddess\r\n\r\n\r\n\r\n[LogServer]\r\n\r\n;客服日志数据库服务器：机器名或IP\r\n\r\nServer=192.168.22.53\r\n\r\n\r\n\r\n;操作数据库用的用户名\r\n\r\nUserName=anonymous\r\n\r\n\r\n\r\n;操作数据库用的密码\r\n\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n\r\n\r\n;指定数据库服务器上的数据库，玩家物品操作日志和玩家行为日志将会保存在这个数据库中\r\n\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\n\r\nDatabase=global_logserver\r\n\r\n\r\n\r\n;最小物品价值量(该值为unsigned类型)，低于该价值的物品，其操作日志被过滤，不存入数据库\r\n\r\nMinItemValue=0\r\n\r\n\r\n\r\n;最低行为重要等级(该值为unsigned类型)，低于该值的玩家行为日志被过滤，不存入数据库\r\n\r\nMinPlayerActionLevel=0\r\n\r\n\r\n\r\n[NameServer]\r\n\r\n;唯一命名数据库服务器：机器名或IP\r\n\r\nServer=192.168.22.53\r\n\r\n\r\n\r\n;操作数据库用的用户名\r\n\r\nUserName=anonymous\r\n\r\n\r\n\r\n;操作数据库用的密码\r\n\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n\r\n\r\n;指定唯一命名服务器上的数据库，用于创建唯一的角色名，帮会名等\r\n\r\n;如果该数据库在服务器上不存在，将会自动创建\r\n\r\nDatabase=swdev10_nameserver\r\n\r\n\r\n\r\n;在一个大区内，一个帐号允许创建的最大角色数目\r\n\r\n;若设置为0，表示不限制一个帐号所能创建的角色数目\r\n\r\nMaxRoleCountInAccountPerZone=12\r\n\r\n\r\n\r\n[RoleStatistic]\r\n\r\n;监听IP、端口，供统计程序KG_StatGameData发送统计结果给Goddess\r\n\r\nListenIP=127.0.0.1\r\n\r\nListenPort=6001\r\n\r\n\r\n\r\n;收发数据的超时时间，单位为毫秒\r\n\r\nSendRecvTimeout=60000\r\n\r\n\r\n\r\n[Control]\r\n\r\n;这一节为linux下的UI控制使用的。\r\n\r\n;如果DaemonFlag＝1，则程序进入后台运行\r\n\r\n;(不显示控制界面，需要用telnet连接到下面的端口控制程序）；\r\n\r\n;否则按一般程序运行（提供界面控制）。\r\n\r\n;ControlPort是为了重新获得控制程序终端的端口\r\n\r\n;如果要在同一台机器上运行几个goddess服务，下面的端口每个服务都不能相同\r\n\r\nDaemonFlag=1\r\n\r\nControlPort=7001\r\n',240,NULL,NULL,NULL),
  (698,'192.168.22.36','../gamecenter/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,5,'[Gamecenter]\r\n;本机IP\r\nLocalIp=localhost\r\n;开放端口\r\nPort=5135\r\n\r\n[DatabaseServer]\r\n;数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n;数据库服务器：端口\r\nPort=3306\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n;指定数据库服务器上的数据库，角色信息将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\nDatabase=swdev10_gamecenter\r\n\r\n[StatLogDatabase]\r\n;统计Log数据库服务器：机器名或IP\r\nServer=192.168.22.53\r\n;统计Log数据库服务器：端口\r\nPort=3306\r\n;操作数据库用的用户名\r\nUserName=anonymous\r\n;操作数据库用的密码\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n;指定数据库服务器上的数据库，角色信息将会保存在这个数据库中\r\n;如果该数据库在数据库服务器上不存在，将会自动创建\r\nDatabase=swdev10_statlog\r\n\r\n[Bishop]\r\nServerIP=localhost\r\nPort=5632\r\n\r\n[Log]\r\nIp=localhost\r\nPort=5656\r\n\r\n[Goddess]\r\nIp=127.0.0.1\r\nPort=5001\r\n',240,'192.168.20.198','swdev10',NULL),
  (699,'192.168.22.36','../logserver/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,7,'[Connection]\r\n\r\n;LogServer服务端口，缺省为5656\r\n\r\nPort=5656\r\n\r\n\r\n\r\n[Database]\r\n\r\n;MySQL服务器的IP\r\n\r\nHost=192.168.22.53\r\n\r\n;MySQL服务器的端口，缺省为3306\r\n\r\nPort=3306\r\n\r\n;MySQL的登录用户名\r\n\r\nUser=anonymous\r\n\r\n;登录密码\r\n\r\nPassword=_eHJKA_UKMEMeNvR__ZOCLQjYUQjWQPE\r\n\r\n;数据库名\r\n\r\nDatabase=swdev10_logserver\r\n\r\n',240,NULL,NULL,NULL),
  (700,'192.168.22.36','../gameserver01/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'192.168.22.106',5678,NULL,3,1,'[Gateway]\r\n\r\nIp=localhost\r\n\r\nPort=5633\r\n\r\n\r\n\r\n[Database]\r\n\r\nIp=localhost\r\n\r\nPort=5001\r\n\r\n\r\n\r\n[Log]\r\n\r\nIp=localhost\r\n\r\nPort=5656\r\n\r\n\r\n\r\n[Gamecenter]\r\n\r\nIp=localhost\r\n\r\nPort=5135\r\n\r\n\r\n\r\n[GameServer]\r\n\r\nServerID=11111\r\n\r\nInAdapterIdx=1\r\n\r\nOutAdapterIdx=1\r\n\r\nInIp=\r\n\r\nOutIp=\r\n\r\nPort=6042\r\n\r\nSendInterval=4\r\n\r\n\r\n\r\n[Overload]\r\n\r\nMaxPlayer=500\r\n\r\nPrecision=0\r\n\r\n\r\n\r\n;服务器自身加载地图（只对MiniServer有效）\r\n\r\n[WorldSet]\r\n\r\nCount=37\r\n\r\nWorld00=1\r\n\r\nWorld01=2\r\n\r\nWorld02=3\r\n\r\nWorld03=4\r\n\r\nWorld04=5\r\n\r\nWorld05=6\r\n\r\nWorld06=30\r\n\r\nWorld07=29\r\n\r\nWorld08=225\r\n\r\nWorld09=226\r\n\r\nWorld10=227\r\n\r\nWorld11=228\r\n\r\nWorld12=229\r\n\r\nWorld13=230\r\n\r\nWorld14=231\r\n\r\nWorld15=232\r\n\r\nWorld16=399\r\n\r\nWorld17=399\r\n\r\nWorld18=227\r\n\r\nWorld19=228\r\n\r\nWorld20=229\r\n\r\nWorld21=230\r\n\r\nWorld22=231\r\n\r\nWorld23=232\r\n\r\nWorld24=274\r\n\r\nWorld25=333\r\n\r\nWorld26=334\r\n\r\nWorld27=335\r\n\r\nWorld28=336\r\n\r\nWorld29=337\r\n\r\nWorld30=338\r\n\r\nWorld31=339\r\n\r\nWorld32=340\r\n\r\nWorld33=23\r\n\r\nWorld34=24\r\n\r\nWorld35=25\r\n\r\nWorld36=399\r\n\r\n',240,NULL,NULL,NULL);
