  (345,235,8,'',263,'GM[张帆]对服务器[swtest3_中心服务器]发送GM指令[GlobalExcute({\"GM:DoCommand\", [[\r\nlocal tbDel = {\r\n\t{113,\"吴学长\",1076},\r\n\t{113,\"太学生\",1078},\r\n\t{113,\"裴知院\",1083},\r\n\t{113,\"木学士\",1084},\r\n\t{113,\"银库看守\",1089},\r\n\t{221,\"大内高手\",1080},\r\n\t{107,\"影子会帮众\",644},\r\n\t{107,\"电光矛\",645},\r\n\t{107,\"金国云骑兵\",647},\r\n\t{218,\"怪老头\",1063},\r\n\t{112,\"徒子丹\",649},\r\n\t{112,\"守卫\",914},\r\n\t{112,\"天月道长\",938},\r\n\t{112,\"玄妙山庄道士\",1005},\r\n\t{112,\"乌蛮队长\",1019},\r\n\t{112,\"丁前溪\",1020},\r\n\t{220,\"鬼主侍卫\",919},\r\n\t{220,\"道隐真人\",1016},\r\n\t{220,\"道玄真人\",1017},\r\n\t{220,\"道人守卫\",1021},\r\n\t{108,\"龙型雕像\",652},\r\n\t{219,\"格西\",936},\r\n\t{219,\"玄衣道人\",939},\r\n};\r\nfor _, tb in ipairs(tbDel) do\r\n\tlocal tbIdx = KNpc.GetMapNpcWithName(tb[1],tb[2]);\r\n\tprint(\"DelNpc\", tb[2], #tbIdx);\r\n\tfor _, nIdx in ipairs(tbIdx) do\r\n\t\tlocal pNpc = KNpc.GetByIndex(nIdx);\r\n\t\tif (pNpc and pNpc.nTemplateId == tb[3]) then\r\n\t\t\tpNpc.Delete();\r\n\t\telse\r\n\t\t\tprint(\"DelNpc Error!\", pNpc and pNpc.nTemplateId);\r\n\t\tend\r\n\tend\r\nend\r\n]]});\r\nreturn 1;\r\n][成功]','2008-07-11 05:47:07',2),
