  (376,236,8,'',263,'GM[罗宝航]对服务器[swtest3_中心服务器]发送GM指令[\r\nGlobalExcute{\"GM:DoCommand\", [[\r\nfunction Item:Compose(tbComItem, nMoneyType)\r\n\tif (CanCompose(tbComItem, nMoneyType) ~= 1) or (Compose_Del(tbComItem, nMoneyType) ~= 1) then\r\n\t\treturn 0;\r\n\tend\r\n\tlocal nMinLevel, nMinLevelRate, nMaxLevel, nMaxLevelRate, nFee, bBind, tbAbsTime = Item:GetComposeBudget(tbComItem, nMoneyType);\t\r\n\tlocal nRandom = Random(nMinLevelRate + nMaxLevelRate);\r\n\tlocal nResultLevel = 0;\r\n\tif nRandom < nMinLevelRate then\r\n\t\tnResultLevel = nMinLevel;\r\n\telse\r\n\t\t-- 合成了较高级的玄晶\r\n\t\tnResultLevel = nMaxLevel;\r\n\tend\r\n\t-- 给予玄晶\r\n\tlocal pItem;\r\n\tlocal tbGive = {}\r\n\ttbGive.bForceBind = bBind;\r\n\tif tbAbsTime then\r\n\t\ttbGive.bTimeOut = 1;\r\n\tend\r\n\tpItem = me.AddItemEx(PEEL_ITEM.nGenre, PEEL_ITEM.nDetail, PEEL_ITEM.nParticular, nResultLevel, tbGive);\r\n\tif pItem and tbAbsTime then\r\n\t\tlocal nTime = os.time({year = tbAbsTime[1], month=tbAbsTime[2], day=tbAbsTime[3], hour=tbAbsTime[4], min=tbAbsTime[5]});\r\n\t\tme.SetItemTimeout(pItem, os.date(\"%Y/%m/%d/%H/%M/00\", nTime));\r\n\tend\r\n\tme.ItemLog(pItem, 1, Log.emKITEMLOG_TYPE_COMPOSE, \"\");\r\n\treturn nResultLevel;\r\nend\r\n]]}\r\nreturn 1;\r\n][成功]','2008-07-15 23:27:27',2),
