  (412,236,8,'',263,'GM[罗宝航]对服务器[swtest3_中心服务器]发送GM指令[GlobalExcute{\"GM:DoCommand\", [[\r\nfunction Item:Compose_Del(tbComItem, nMoneyType)\t\r\n\t-- 删除玄晶\r\n\tfor i = 1, #tbComItem do\r\n\t\tlocal nDelRet = me.DelItem(tbComItem[i]);\t\t-- 扣除玄晶\r\n\t\tif nDelRet ~= 1 then\r\n\t\t\tDbg:WriteLog(\"玄晶合成\", \"删除失败:\"..pItem.szName);\r\n\t\t\treturn 0;\r\n\t\tend\r\n\tend\r\n\treturn 1;\r\nend\r\n]]}\r\nreturn 1;][成功]','2008-07-16 00:54:21',2),
