  (18156,236,4,263,'[luobaohang]向服务器[swtest3_中心服务器]发送GM指令[GlobalExcute{\"GM:DoCommand\", [[\r\nfunction Item:CanCompose(tbComItem, nMoneyType)\r\n\tif (me.nFightState ~= 0) then\r\n\t\tme.Msg(\"战斗状态下不能进行此操作！\");\r\n\t\treturn 0;\r\n\tend\r\n\tlocal nMinLevel, nMinLevelRate, nMaxLevel, nMaxLevelRate, nFee, bBind, tbAbsTime = Item:GetComposeBudget(tbComItem, nMoneyType);\r\n\tif nMinLevel < 1 then\r\n\t\tme.Msg(\"不能合成！合成物中有非玄晶道具！\")\r\n\t\treturn 0;\r\n\tend\r\n\t-- 合成玄晶不需检查背包空间的前提是玄晶不可叠加，如果可叠加需要检查背包空间\r\n\t-- TODO\r\n\tif (nMoneyType == Item.NORMAL_MONEY and me.CostMoney(nFee, Player.emKPAY_COMPOSE) ~= 1) then\t-- 扣除金钱\r\n\t\tme.Msg(\"你身上银两不足，不能合成！\");\r\n\t\treturn 0;\r\n\telseif (nMoneyType == Item.BIND_MONEY and me.CostBindMoney(nFee) ~= 1) then\r\n\t\tme.Msg(\"你身上的绑定银两不足，不能合成！\");\r\n\t\treturn 0;\r\n\telseif (nMoneyType ~= Item.NORMAL_MONEY)and (nMoneyType ~= Item.BIND_MONEY) then\r\n\t\treturn 0;\r\n\tend\r\n\t\r\n\treturn 1;\r\nend\r\n]]}\r\nreturn 1;\r\n][成功]','2008-07-15 23:13:30'),
