  (18212,236,4,263,'[luobaohang]向服务器[swtest3_中心服务器]发送GM指令[GlobalExcute{\"GM:DoCommand\", [[\r\nfunction Item:CanCompose(tbComItem, nMoneyType, nMinLevel, nFee)\r\n\tif (me.nFightState ~= 0) then\r\n\t\tme.Msg(\"战斗状态下不能进行此操作！\");\r\n\t\treturn 0;\r\n\tend\r\n\tif nMinLevel < 1 then\r\n\t\tme.Msg(\"不能合成！合成物中有非玄晶道具！\")\r\n\t\treturn 0;\r\n\tend\r\n\tif (nMoneyType == Item.NORMAL_MONEY and me.CostMoney(nFee, Player.emKPAY_COMPOSE) ~= 1) then\t-- 扣除金钱\r\n\t\tme.Msg(\"你身上银两不足，不能合成！\");\r\n\t\treturn 0;\r\n\telseif (nMoneyType == Item.BIND_MONEY and me.CostBindMoney(nFee) ~= 1) then\r\n\t\tme.Msg(\"你身上的绑定银两不足，不能合成！\");\r\n\t\treturn 0;\r\n\telseif (nMoneyType ~= Item.NORMAL_MONEY)and (nMoneyType ~= Item.BIND_MONEY) then\r\n\t\treturn 0;\r\n\tend\t\r\n\treturn 1;\r\nend\r\n]]}\r\nreturn 1;\r\n][成功]','2008-07-16 00:54:12'),
  (18213,236,4,263,'[luobaohang]向服务器[swtest3_中心服务器]发送GM指令[GlobalExcute{\"GM:DoCommand\", [[\r\nfunction Item:Compose_Del(tbComItem, nMoneyType)\t\r\n\t-- 删除玄晶\r\n\tfor i = 1, #tbComItem do\r\n\t\tlocal nDelRet = me.DelItem(tbComItem[i]);\t\t-- 扣除玄晶\r\n\t\tif nDelRet ~= 1 then\r\n\t\t\tDbg:WriteLog(\"玄晶合成\", \"删除失败:\"..pItem.szName);\r\n\t\t\treturn 0;\r\n\t\tend\r\n\tend\r\n\treturn 1;\r\nend\r\n]]}\r\nreturn 1;][成功]','2008-07-16 00:54:21'),
  (18214,236,4,263,'[luobaohang]向服务器[swtest3_中心服务器]发送GM指令[GlobalExcute{\"GM:DoCommand\", [[\r\nfunction Item:Compose_CalcLevel(tbComItem, nMoneyType, nMinLevel, nMinLevelRate, nMaxLevel, nMaxLevelRate)\r\n\tlocal nRandom = Random(nMinLevelRate + nMaxLevelRate);\r\n\tlocal nResultLevel = 0;\r\n\tif nRandom < nMinLevelRate then\r\n\t\tnResultLevel = nMinLevel;\r\n\telse\r\n\t\t-- 合成了较高级的玄晶\r\n\t\tnResultLevel = nMaxLevel;\r\n\tend\r\n\t\r\n\treturn nResultLevel;\r\nend\r\n]]}\r\nreturn 1;][成功]','2008-07-16 00:54:29'),
